import React from "react";

export default function ShoppingCart({ shoppingCartItems }) {
  const numberOfItems = shoppingCartItems.length;
  console.log(shoppingCartItems);
  return (
    <div className="shopping-cart-container">
      <header className="shopping-cart-header">
        <h1 className="text-2xl font-bold">
          You have {numberOfItems} in your basket{" "}
        </h1>
        <p>
          <img className="icons" src="./images/shoppingCart/building.png" />
          Buy confidently with Etsy's Purchase Protection programme for buyers,
          get a full refund in the rare case your item doesn't arrive, arrives
          damaged, or isn't as described.
        </p>
      </header>
    </div>
  );
}
